export const Content = ()=>{
    const [title, setTitle] = useState('')
    const [todos, setTodos] = useState([])

    useEffect(()=>{
        fetch('https://jsonplaceholder.typicode.com/todos')
            .then(res => res.json)
            .then(todos => {setTodos(todos)})
    })

    return(
       <div>
           <input 
            value={title}
            onChange={e => setTitle(e.target.value)}

           />

           <ul>
               <li>

               </li>
           </ul>
       </div>
    )
}
